import ChatList from "./chat-list"
import "./chat.css"

class Chat extends Component {
    constructor() {
        super()
        this.state = {
            userlist: [{ name: "subho", type: "group" }],
            activeuser: {
                name: "subho",
                type: "group",
            },
        }
    }

    handleDelete = (user) => {}
    handleDisplay = (user) => {}
    handleLogout = () => {}
    handleAddFriend = () => {}
    handleAddGroup = () => {}

    render() {
        return (
            <div className="container">
                <ChatHeader />
                <div className="section-2">
                    <ChatList
                        users={this.state.userlist}
                        onDelete={this.handleDelete}
                        onDisplay={this.handleDisplay}
                    />
                </div>
            </div>
        )
    }
}

export default Chat
